export default function Exclusive() {
    return (
        <section>
            <div className="row">
                <div className="col-md-8"><h3>For your first Qshop Experience<br />Exclusive Qara Products</h3></div>
                <div className="col-md-4"></div>
            </div>
        </section>
    );
}
